import React, { useState } from 'react'

function Search() {
	const [type, setType] = useState("none")
	return (
		<div className='Search'>
			<input type="text" placeholder='Kinolarni qidirish' />
			<button onClick={() => setType("all")}>Barcha kinolar</button>
			<button onClick={() => setType("pop")} className={type === "most" && "actv"}>Mashhur kinolar</button>
			<button onClick={() => setType("most")} className={type === "most" && "actv"}>Eng ko'p ko'rilgan kinolar</button>
		</div>
	)
}

export default Search
